import Carousel from 'react-bootstrap/Carousel';
import '../styles/Slide.css';
import PromoCarousel from '../';

function CustomCarousel() {
  return (
    <Carousel>
      <Carousel.Item>
        <PromoCarousel />
        <Carousel.Caption>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <PromoCarousel />
        <Carousel.Caption>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <PromoCarousel />
        <Carousel.Caption>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default CustomCarousel;
